function Header() {
    return (
      <div className="header">
        <div className="logoContainer">SHOP NAME</div>
        <div>
            <div className="navElement">CART</div>
            <div className="navElement">WISHLIST</div>
            <div className="navElement">ORDER</div>
        </div>
      </div>
    );
  }


  export default Header;
